{"collection": "pnuks-1", "name": "PNUKS", "description": "The first true bull market of NFTs in 2021 cemented CryptoPunks as the greatest PFP collection in history. That market was monumental, a renaissance of digital art. Artists and collectors were only beginning to build the culture of NFT art, giving rise to countless new genres and forms.

Pnuks, on the other hand, are the portrait of a new cycle. The bear market drove out most artists and collectors, while platforms for selling art were forced to become even simpler. The ease of minting and cheap gas fees unleashed a flood of "trench art."

While CryptoPunks embodied the first cycle—astonishingly expensive, impeccably crafted, and legendary - Pnuks are absurd, degenerate, simple, and cheap, just like the second NFT bull cycle.", "image_url": "https://i2.seadn.io/base/0x3d8683bbf9cae7ad0441b65ddcadec3850d1256e/f06cc5f91bc7538041f0598138b9f56a.png", "banner_image_url": "", "owner": "0x014c2b84bce4f4ec280c8d91d9f6a9eb46063daf", "safelist_status": "verified", "category": "ART", "is_disabled": false, "is_nsfw": false, "trait_offers_enabled": true, "collection_offers_enabled": true, "opensea_url": "https://opensea.io/collection/pnuks-1", "project_url": "", "wiki_url": "", "discord_url": "", "telegram_url": "", "twitter_username": "timso_eth", "instagram_username": "", "contracts": [{"address": "0x3d8683bbf9cae7ad0441b65ddcadec3850d1256e", "chain": "base"}]}

{"collection": "okcomputers", "name": "OK COMPUTERS", "description": "**OK COMPUTERS is a 100% onchain social network running inside each NFT.  Think Web3 Geocities, games, message boards, and more.**

Each bot is linked through an innovative onchain communications protocol, enabling users to message other bots, post on message boards, and even build onchain webpages — reminiscent of a web3 Geocities — all accessible directly through their interactive terminal.

An official collaboration between [@dailofrog](https://x.com/dailofrog) x [Bankr](https://bankr.bot/terminal). Pixel art by [@goopgoop_art](https://x.com/goopgoop_art). Banner by [@facuserif](https://x.com/facuserif).", "image_url": "https://i2.seadn.io/base/05d807397e5b420d8b9cc7cb8cb07a0d/549fb12b972ea6f3790a2965d31686/55549fb12b972ea6f3790a2965d31686.gif", "banner_image_url": "", "owner": "0xe3f414db54873abc3ece1d23c6d5bb3673923a57", "safelist_status": "verified", "category": "ART", "is_disabled": false, "is_nsfw": false, "trait_offers_enabled": true, "collection_offers_enabled": true, "opensea_url": "https://opensea.io/collection/okcomputers", "project_url": "https://okcomputers.xyz", "wiki_url": "", "discord_url": "", "telegram_url": "", "twitter_username": "dailofrog", "instagram_username": "", "contracts": [{"address": "0xce2830932889c7fb5e5206287c43554e673dcc88", "chain": "base"}]}
